tables.table_schema:
CREATE TABLE car_models (
    id UUID PRIMARY KEY,
    model_name STRING,
    manufacturer STRING,
    year INT
);

CREATE TABLE fuel_efficiency (
    id UUID PRIMARY KEY,
    car_model_id UUID REFERENCES car_models(id),
    city_mpg FLOAT,
    highway_mpg FLOAT
);

CREATE TABLE emissions (
    id UUID PRIMARY KEY,
    car_model_id UUID REFERENCES car_models(id),
    co2_emissions FLOAT,
    nitrogen_oxides FLOAT
);

CREATE TABLE engine_specs (
    id UUID PRIMARY KEY,
    car_model_id UUID REFERENCES car_models(id),
    engine_type STRING,
    horsepower INT
);

CREATE TABLE fuel_types (
    id UUID PRIMARY KEY,
    fuel_type STRING,
    octane_rating INT
);
